          <Header className="site-layout-background" style={{ padding: 0 }}>
            <Headers />
            {React.createElement(
              state.collapsed ? MenuUnfoldOutlined : MenuFoldOutlined,
              {
                className: "trigger",
                onClick: toggle,
              }
            )}
          </Header>
          <Content
            className="site-layout-background"
            style={{
              margin: "24px 16px",
              padding: 24,
              minHeight: 280,
            }}
          >
            <Switch>{user ? Authentication(user.role) : ""}</Switch>
          </Content>
        </Layout>
      </Layout>
    </div>
  );
}
